DROP TABLE IF EXISTS CITY;
CREATE TABLE IF NOT EXISTS CITY (
	CITY_NAME varchar(20),
	STATE varchar(2),
	PRIMARY KEY (CITY_NAME)
);


DROP TABLE IF EXISTS RENT;
CREATE TABLE IF NOT EXISTS RENT (
	CITY_NAME varchar(20),
	RENT varchar(10),
	PRIMARY KEY (CITY_NAME)
);

DROP TABLE IF EXISTS FOOD;
CREATE TABLE IF NOT EXISTS FOOD (
	CITY_NAME varchar(20),
	APPLES varchar(20),
	BANANA varchar(20),
	BEEF_ROUND varchar(20),
	WINE varchar(20),
	CHICKEN_FILLET varchar(20),
	CIGARETTES varchar(20),
	DOMESTIC_BEER varchar(20),
	EGGS varchar(20),
	IMPORTED_BEER varchar(20),
	LETTUCE varchar(20),
	BREAD varchar(20),
	CHEESE varchar(20),
	MILK varchar(20),
	ONION varchar(20),
	ORANGES varchar(20),
	POTATO varchar(20),
	RICE varchar(20),
	TOMATO varchar(20),
	WATER varchar(20),
	PRIMARY KEY (CITY_NAME)
);
